function exec_evaluation(turn) {
  /** 检查turn中某字段是否等于目标值（仅处理Equals规则） */
  const TARGET_VALUE = "Text";

  try {
    // 直接访问目标字段
    const current = turn.turn.actual_output.text;

    const isEqual = current === TARGET_VALUE;
    const score = isEqual ? 1.0 : 0.0;
    const reason = `字段'turn.actual_output.text'的值为'${current}'，与目标值'${TARGET_VALUE}'${isEqual ? '相等' : '不相等'}`;

    return { score, reason };
  } catch (e) {
    if (e instanceof TypeError || e instanceof ReferenceError) {
      return { score: 0.0, reason: `字段路径不存在：${e.message}` };
    }
    return { score: 0.0, reason: `检查出错：${e.message}` };
  }
}
